def expand(s):
    expanded = []
    for i in range(len(s) - 1):
        k = s[i : i + 2]
        if k in data:
            v = data[k]
            # print(f"{k} => {v}")
            expanded.append(s[i] + v)

    expanded = "".join(expanded)
    return expanded + s[-1]


