def count_letters(s):
    count = {}
    for c in s:
        if c in count:
            count[c] += 1
        else:
            count[c] = 1
    c_max = max(count.values())
    c_min = min(count.values())
    return c_min, c_max


def expand_2(s):
    # print(f"s = {s}")
    if len(s) == 0:
        return ""
    if len(s) == 1:
        return s
    if len(s) == 2:
        return data[s] + s[-1]
    # if s in data:
    #     return data[s]
    l_len = int(len(s) / 2)
    left = s[:l_len]
    right = s[l_len:]
    # print(f"l = {left}{right}")
    # input('')
    joint = data[left[-1] + right[0]][1:]
    e_left = expand_2(left)
    e_right = expand_2(right)
    data[left] = e_left
    data[right] = e_right
    return e_left + joint + e_right


